using Tests

@testset "6.1 Hyperbolic sine" begin
	@test integrate((c + d*x)^4*sinh(a + b*x), x) == :((24*d^4*cosh(a + b*x))/b^5 + (12*d^2*(c + d*x)^2*cosh(a + b*x))/b^3 + ((c + d*x)^4*cosh(a + b*x))/b - (24*d^3*(c + d*x)*sinh(a + b*x))/b^4 - (4*d*(c + d*x)^3*sinh(a + b*x))/b^2)
	@test integrate((c + d*x)^3*sinh(a + b*x), x) == :((6*d^2*(c + d*x)*cosh(a + b*x))/b^3 + ((c + d*x)^3*cosh(a + b*x))/b - (6*d^3*sinh(a + b*x))/b^4 - (3*d*(c + d*x)^2*sinh(a + b*x))/b^2)
	@test integrate((c + d*x)^2*sinh(a + b*x), x) == :((2*d^2*cosh(a + b*x))/b^3 + ((c + d*x)^2*cosh(a + b*x))/b - (2*d*(c + d*x)*sinh(a + b*x))/b^2)
	@test integrate((c + d*x)*sinh(a + b*x), x) == :(((c + d*x)*cosh(a + b*x))/b - (d*sinh(a + b*x))/b^2)
	@test integrate(sinh(a + b*x)/(c + d*x), x) == :((coshIntegral((b*c)/d + b*x)*sinh(a - (b*c)/d))/d + (cosh(a - (b*c)/d)*sinhIntegral((b*c)/d + b*x))/d)
	@test integrate(sinh(a + b*x)/(c + d*x)^2, x) == :((b*cosh(a - (b*c)/d)*coshIntegral((b*c)/d + b*x))/d^2 - sinh(a + b*x)/(d*(c + d*x)) + (b*sinh(a - (b*c)/d)*sinhIntegral((b*c)/d + b*x))/d^2)
	@test integrate(sinh(a + b*x)/(c + d*x)^3, x) == :(-(b*cosh(a + b*x))/(2*d^2*(c + d*x)) + (b^2*coshIntegral((b*c)/d + b*x)*sinh(a - (b*c)/d))/(2*d^3) - sinh(a + b*x)/(2*d*(c + d*x)^2) + (b^2*cosh(a - (b*c)/d)*sinhIntegral((b*c)/d + b*x))/(2*d^3))
	@test integrate((c + d*x)^4*sinh(a + b*x)^2, x) == :((-3*d^4*x)/(4*b^4) - (d*(c + d*x)^3)/(2*b^2) - (c + d*x)^5/(10*d) + (3*d^4*cosh(a + b*x)*sinh(a + b*x))/(4*b^5) + (3*d^2*(c + d*x)^2*cosh(a + b*x)*sinh(a + b*x))/(2*b^3) + ((c + d*x)^4*cosh(a + b*x)*sinh(a + b*x))/(2*b) - (3*d^3*(c + d*x)*sinh(a + b*x)^2)/(2*b^4) - (d*(c + d*x)^3*sinh(a + b*x)^2)/b^2)
	@test integrate((c + d*x)^3*sinh(a + b*x)^2, x) == :((-3*c*d^2*x)/(4*b^2) - (3*d^3*x^2)/(8*b^2) - (c + d*x)^4/(8*d) + (3*d^2*(c + d*x)*cosh(a + b*x)*sinh(a + b*x))/(4*b^3) + ((c + d*x)^3*cosh(a + b*x)*sinh(a + b*x))/(2*b) - (3*d^3*sinh(a + b*x)^2)/(8*b^4) - (3*d*(c + d*x)^2*sinh(a + b*x)^2)/(4*b^2))
	@test integrate((c + d*x)^2*sinh(a + b*x)^2, x) == :(-(d^2*x)/(4*b^2) - (c + d*x)^3/(6*d) + (d^2*cosh(a + b*x)*sinh(a + b*x))/(4*b^3) + ((c + d*x)^2*cosh(a + b*x)*sinh(a + b*x))/(2*b) - (d*(c + d*x)*sinh(a + b*x)^2)/(2*b^2))
	@test integrate((c + d*x)*sinh(a + b*x)^2, x) == :(-(c*x)/2 - (d*x^2)/4 + ((c + d*x)*cosh(a + b*x)*sinh(a + b*x))/(2*b) - (d*sinh(a + b*x)^2)/(4*b^2))
	@test integrate(sinh(a + b*x)^2/(c + d*x), x) == :((cosh(2*a - (2*b*c)/d)*coshIntegral((2*b*c)/d + 2*b*x))/(2*d) - log(c + d*x)/(2*d) + (sinh(2*a - (2*b*c)/d)*sinhIntegral((2*b*c)/d + 2*b*x))/(2*d))
	@test integrate(sinh(a + b*x)^2/(c + d*x)^2, x) == :((b*coshIntegral((2*b*c)/d + 2*b*x)*sinh(2*a - (2*b*c)/d))/d^2 - sinh(a + b*x)^2/(d*(c + d*x)) + (b*cosh(2*a - (2*b*c)/d)*sinhIntegral((2*b*c)/d + 2*b*x))/d^2)
	@test integrate(sinh(a + b*x)^2/(c + d*x)^3, x) == :((b^2*cosh(2*a - (2*b*c)/d)*coshIntegral((2*b*c)/d + 2*b*x))/d^3 - (b*cosh(a + b*x)*sinh(a + b*x))/(d^2*(c + d*x)) - sinh(a + b*x)^2/(2*d*(c + d*x)^2) + (b^2*sinh(2*a - (2*b*c)/d)*sinhIntegral((2*b*c)/d + 2*b*x))/d^3)
	@test integrate(sinh(a + b*x)^2/(c + d*x)^4, x) == :(-b^2/(3*d^3*(c + d*x)) + (2*b^3*coshIntegral((2*b*c)/d + 2*b*x)*sinh(2*a - (2*b*c)/d))/(3*d^4) - (b*cosh(a + b*x)*sinh(a + b*x))/(3*d^2*(c + d*x)^2) - sinh(a + b*x)^2/(3*d*(c + d*x)^3) - (2*b^2*sinh(a + b*x)^2)/(3*d^3*(c + d*x)) + (2*b^3*cosh(2*a - (2*b*c)/d)*sinhIntegral((2*b*c)/d + 2*b*x))/(3*d^4))
	@test integrate((c + d*x)^4*sinh(a + b*x)^3, x) == :((-488*d^4*cosh(a + b*x))/(27*b^5) - (80*d^2*(c + d*x)^2*cosh(a + b*x))/(9*b^3) - (2*(c + d*x)^4*cosh(a + b*x))/(3*b) + (8*d^4*cosh(a + b*x)^3)/(81*b^5) + (160*d^3*(c + d*x)*sinh(a + b*x))/(9*b^4) + (8*d*(c + d*x)^3*sinh(a + b*x))/(3*b^2) + (4*d^2*(c + d*x)^2*cosh(a + b*x)*sinh(a + b*x)^2)/(9*b^3) + ((c + d*x)^4*cosh(a + b*x)*sinh(a + b*x)^2)/(3*b) - (8*d^3*(c + d*x)*sinh(a + b*x)^3)/(27*b^4) - (4*d*(c + d*x)^3*sinh(a + b*x)^3)/(9*b^2))
	@test integrate((c + d*x)^3*sinh(a + b*x)^3, x) == :((-40*d^2*(c + d*x)*cosh(a + b*x))/(9*b^3) - (2*(c + d*x)^3*cosh(a + b*x))/(3*b) + (40*d^3*sinh(a + b*x))/(9*b^4) + (2*d*(c + d*x)^2*sinh(a + b*x))/b^2 + (2*d^2*(c + d*x)*cosh(a + b*x)*sinh(a + b*x)^2)/(9*b^3) + ((c + d*x)^3*cosh(a + b*x)*sinh(a + b*x)^2)/(3*b) - (2*d^3*sinh(a + b*x)^3)/(27*b^4) - (d*(c + d*x)^2*sinh(a + b*x)^3)/(3*b^2))
	@test integrate((c + d*x)^2*sinh(a + b*x)^3, x) == :((-14*d^2*cosh(a + b*x))/(9*b^3) - (2*(c + d*x)^2*cosh(a + b*x))/(3*b) + (2*d^2*cosh(a + b*x)^3)/(27*b^3) + (4*d*(c + d*x)*sinh(a + b*x))/(3*b^2) + ((c + d*x)^2*cosh(a + b*x)*sinh(a + b*x)^2)/(3*b) - (2*d*(c + d*x)*sinh(a + b*x)^3)/(9*b^2))
	@test integrate((c + d*x)*sinh(a + b*x)^3, x) == :((-2*(c + d*x)*cosh(a + b*x))/(3*b) + (2*d*sinh(a + b*x))/(3*b^2) + ((c + d*x)*cosh(a + b*x)*sinh(a + b*x)^2)/(3*b) - (d*sinh(a + b*x)^3)/(9*b^2))
	@test integrate(sinh(a + b*x)^3/(c + d*x), x) == :((coshIntegral((3*b*c)/d + 3*b*x)*sinh(3*a - (3*b*c)/d))/(4*d) - (3*coshIntegral((b*c)/d + b*x)*sinh(a - (b*c)/d))/(4*d) - (3*cosh(a - (b*c)/d)*sinhIntegral((b*c)/d + b*x))/(4*d) + (cosh(3*a - (3*b*c)/d)*sinhIntegral((3*b*c)/d + 3*b*x))/(4*d))
	@test integrate(sinh(a + b*x)^3/(c + d*x)^2, x) == :((-3*b*cosh(a - (b*c)/d)*coshIntegral((b*c)/d + b*x))/(4*d^2) + (3*b*cosh(3*a - (3*b*c)/d)*coshIntegral((3*b*c)/d + 3*b*x))/(4*d^2) - sinh(a + b*x)^3/(d*(c + d*x)) - (3*b*sinh(a - (b*c)/d)*sinhIntegral((b*c)/d + b*x))/(4*d^2) + (3*b*sinh(3*a - (3*b*c)/d)*sinhIntegral((3*b*c)/d + 3*b*x))/(4*d^2))
	@test integrate(sinh(a + b*x)^3/(c + d*x)^3, x) == :((9*b^2*coshIntegral((3*b*c)/d + 3*b*x)*sinh(3*a - (3*b*c)/d))/(8*d^3) - (3*b^2*coshIntegral((b*c)/d + b*x)*sinh(a - (b*c)/d))/(8*d^3) - (3*b*cosh(a + b*x)*sinh(a + b*x)^2)/(2*d^2*(c + d*x)) - sinh(a + b*x)^3/(2*d*(c + d*x)^2) - (3*b^2*cosh(a - (b*c)/d)*sinhIntegral((b*c)/d + b*x))/(8*d^3) + (9*b^2*cosh(3*a - (3*b*c)/d)*sinhIntegral((3*b*c)/d + 3*b*x))/(8*d^3))
	# @test integrate((c + d*x)^3*csch(a + b*x), x, 9, (-2*(c + d*x)^3*atanh(exp((a + b*x))))/b - (3*d*(c + d*x)^2*Polylog(2, -exp((a + b*x))))/b^2 + (3*d*(c + d*x)^2*Polylog(2, exp((a + b*x))))/b^2 + (6*d^2*(c + d*x)*Polylog(3, -exp((a + b*x))))/b^3 - (6*d^2*(c + d*x)*Polylog(3, E^(a + b*x)])/b^3 - (6*d^3*PolyLog[4) == :(exp((a + b*x))))/b^4)
	# @test integrate((c + d*x)^2*csch(a + b*x), x, 7, (-2*(c + d*x)^2*atanh(exp((a + b*x))))/b - (2*d*(c + d*x)*Polylog(2, -exp((a + b*x))))/b^2 + (2*d*(c + d*x)*Polylog(2, E^(a + b*x)])/b^2 + (2*d^2*PolyLog[3) == :(exp((a + b*x))))/b^3)
	# @test integrate((c + d*x)*csch(a + b*x), x, 5, (-2*(c + d*x)*ArcTanh[E^(a + b*x)])/b - (d*PolyLog[2) == :(exp((a + b*x))))/b^2)
	# @test integrate(csch(a + b*x)/(c + d*x), x, 0) == :(x))
	# @test integrate(csch(a + b*x)/(c + d*x)^2, x, 0) == :(x))
	# @test integrate((c + d*x)^3*csch(a + b*x)^2, x, 6, -((c + d*x)^3/b) - ((c + d*x)^3*Coth[a + b*x])/b + (3*d*(c + d*x)^2*Log[1 - E^(2*(a + b*x))])/b^2 + (3*d^2*(c + d*x)*PolyLog[2) == :(exp((2*(a + b*x)))))/(2*b^4))
	# @test integrate((c + d*x)^2*csch(a + b*x)^2, x, 5) == :(exp((2*(a + b*x)))))/b^3)
	@test integrate((c + d*x)*csch(a + b*x)^2, x) == :(-(((c + d*x)*coth(a + b*x))/b) + (d*log(sinh(a + b*x)))/b^2)
	# @test integrate(csch(a + b*x)^2/(c + d*x), x, 0) == :(x))
	# @test integrate(csch(a + b*x)^2/(c + d*x)^2, x, 0) == :(x))
	# @test integrate((c + d*x)^3*csch(a + b*x)^3, x, 15, (-6*d^2*(c + d*x)*atanh(exp((a + b*x))))/b^3 + ((c + d*x)^3*atanh(exp((a + b*x))))/b - (3*d*(c + d*x)^2*csch(a + b*x))/(2*b^2) - ((c + d*x)^3*coth(a + b*x)*csch(a + b*x))/(2*b) - (3*d^3*Polylog(2, -exp((a + b*x))))/b^4 + (3*d*(c + d*x)^2*Polylog(2, -exp((a + b*x))))/(2*b^2) + (3*d^3*Polylog(2, exp((a + b*x))))/b^4 - (3*d*(c + d*x)^2*Polylog(2, exp((a + b*x))))/(2*b^2) - (3*d^2*(c + d*x)*Polylog(3, -exp((a + b*x))))/b^3 + (3*d^2*(c + d*x)*Polylog(3, E^(a + b*x)])/b^3 + (3*d^3*PolyLog[4) == :(exp((a + b*x))))/b^4)
	# @test integrate((c + d*x)^2*csch(a + b*x)^3, x, 9, ((c + d*x)^2*atanh(exp((a + b*x))))/b - (d^2*atanh(cosh(a + b*x)))/b^3 - (d*(c + d*x)*csch(a + b*x))/b^2 - ((c + d*x)^2*coth(a + b*x)*csch(a + b*x))/(2*b) + (d*(c + d*x)*Polylog(2, -exp((a + b*x))))/b^2 - (d*(c + d*x)*Polylog(2, E^(a + b*x)])/b^2 - (d^2*PolyLog[3) == :(exp((a + b*x))))/b^3)
	# @test integrate((c + d*x)*csch(a + b*x)^3, x, 6, ((c + d*x)*ArcTanh[E^(a + b*x)])/b - (d*Csch[a + b*x])/(2*b^2) - ((c + d*x)*Coth[a + b*x]*Csch[a + b*x])/(2*b) + (d*PolyLog[2) == :(exp((a + b*x))))/(2*b^2))
	# @test integrate(csch(a + b*x)^3/(c + d*x), x, 0) == :(x))
	# @test integrate(csch(a + b*x)^3/(c + d*x)^2, x, 0) == :(x))
	@test integrate((c + d*x)^(5/2)*sinh(a + b*x), x) == :((15*d^2*sqrt(c + d*x)*cosh(a + b*x))/(4*b^3) + ((c + d*x)^(5/2)*cosh(a + b*x))/b - (15*d^(5/2)*exp((-a + (b*c)/d)*sqrt)(Pi)*erf((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(16*b^(7/2)) - (15*d^(5/2)*exp((a - (b*c)/d)*sqrt)(Pi)*erfi((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(16*b^(7/2)) - (5*d*(c + d*x)^(3/2)*sinh(a + b*x))/(2*b^2))
	@test integrate((c + d*x)^(3/2)*sinh(a + b*x), x) == :(((c + d*x)^(3/2)*cosh(a + b*x))/b - (3*d^(3/2)*exp((-a + (b*c)/d)*sqrt)(Pi)*erf((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(8*b^(5/2)) + (3*d^(3/2)*exp((a - (b*c)/d)*sqrt)(Pi)*erfi((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(8*b^(5/2)) - (3*d*sqrt(c + d*x)*sinh(a + b*x))/(2*b^2))
	@test integrate(sqrt(c + d*x)*sinh(a + b*x), x) == :((sqrt(c + d*x)*cosh(a + b*x))/b - (sqrt(d)*exp((-a + (b*c)/d)*sqrt)(Pi)*erf((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(4*b^(3/2)) - (sqrt(d)*exp((a - (b*c)/d)*sqrt)(Pi)*erfi((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(4*b^(3/2)))
	@test integrate(sinh(a + b*x)/sqrt(c + d*x), x) == :(-(exp((-a + (b*c)/d)*sqrt)(Pi)*erf((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(2*sqrt(b)*sqrt(d)) + (exp((a - (b*c)/d)*sqrt)(Pi)*erfi((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(2*sqrt(b)*sqrt(d)))
	@test integrate(sinh(a + b*x)/(c + d*x)^(3/2), x) == :((sqrt(b)*exp((-a + (b*c)/d)*sqrt)(Pi)*erf((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/d^(3/2) + (sqrt(b)*exp((a - (b*c)/d)*sqrt)(Pi)*erfi((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/d^(3/2) - (2*sinh(a + b*x))/(d*sqrt(c + d*x)))
	@test integrate(sinh(a + b*x)/(c + d*x)^(5/2), x) == :((-4*b*cosh(a + b*x))/(3*d^2*sqrt(c + d*x)) - (2*b^(3/2)*exp((-a + (b*c)/d)*sqrt)(Pi)*erf((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(3*d^(5/2)) + (2*b^(3/2)*exp((a - (b*c)/d)*sqrt)(Pi)*erfi((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(3*d^(5/2)) - (2*sinh(a + b*x))/(3*d*(c + d*x)^(3/2)))
	@test integrate(sinh(a + b*x)/(c + d*x)^(7/2), x) == :((-4*b*cosh(a + b*x))/(15*d^2*(c + d*x)^(3/2)) + (4*b^(5/2)*exp((-a + (b*c)/d)*sqrt)(Pi)*erf((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(15*d^(7/2)) + (4*b^(5/2)*exp((a - (b*c)/d)*sqrt)(Pi)*erfi((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(15*d^(7/2)) - (2*sinh(a + b*x))/(5*d*(c + d*x)^(5/2)) - (8*b^2*sinh(a + b*x))/(15*d^3*sqrt(c + d*x)))
	@test integrate((c + d*x)^(5/2)*sinh(a + b*x)^2, x) == :((-5*d*(c + d*x)^(3/2))/(16*b^2) - (c + d*x)^(7/2)/(7*d) + (15*d^(5/2)*exp((-2*a + (2*b*c)/d)*sqrt)(Pi/2)*erf((sqrt(2)*sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(256*b^(7/2)) - (15*d^(5/2)*exp((2*a - (2*b*c)/d)*sqrt)(Pi/2)*erfi((sqrt(2)*sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(256*b^(7/2)) + ((c + d*x)^(5/2)*cosh(a + b*x)*sinh(a + b*x))/(2*b) - (5*d*(c + d*x)^(3/2)*sinh(a + b*x)^2)/(8*b^2) + (15*d^2*sqrt(c + d*x)*sinh(2*a + 2*b*x))/(64*b^3))
	@test integrate((c + d*x)^(3/2)*sinh(a + b*x)^2, x) == :((-3*d*sqrt(c + d*x))/(16*b^2) - (c + d*x)^(5/2)/(5*d) + (3*d^(3/2)*exp((-2*a + (2*b*c)/d)*sqrt)(Pi/2)*erf((sqrt(2)*sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(64*b^(5/2)) + (3*d^(3/2)*exp((2*a - (2*b*c)/d)*sqrt)(Pi/2)*erfi((sqrt(2)*sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(64*b^(5/2)) + ((c + d*x)^(3/2)*cosh(a + b*x)*sinh(a + b*x))/(2*b) - (3*d*sqrt(c + d*x)*sinh(a + b*x)^2)/(8*b^2))
	@test integrate(sqrt(c + d*x)*sinh(a + b*x)^2, x) == :(-(c + d*x)^(3/2)/(3*d) + (sqrt(d)*exp((-2*a + (2*b*c)/d)*sqrt)(Pi/2)*erf((sqrt(2)*sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(16*b^(3/2)) - (sqrt(d)*exp((2*a - (2*b*c)/d)*sqrt)(Pi/2)*erfi((sqrt(2)*sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(16*b^(3/2)) + (sqrt(c + d*x)*sinh(2*a + 2*b*x))/(4*b))
	@test integrate(sinh(a + b*x)^2/sqrt(c + d*x), x) == :(-(sqrt(c + d*x)/d) + (exp((-2*a + (2*b*c)/d)*sqrt)(Pi/2)*erf((sqrt(2)*sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(4*sqrt(b)*sqrt(d)) + (exp((2*a - (2*b*c)/d)*sqrt)(Pi/2)*erfi((sqrt(2)*sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(4*sqrt(b)*sqrt(d)))
	@test integrate(sinh(a + b*x)^2/(c + d*x)^(3/2), x) == :(-((sqrt(b)*exp((-2*a + (2*b*c)/d)*sqrt)(Pi/2)*erf((sqrt(2)*sqrt(b)*sqrt(c + d*x))/sqrt(d)))/d^(3/2)) + (sqrt(b)*exp((2*a - (2*b*c)/d)*sqrt)(Pi/2)*erfi((sqrt(2)*sqrt(b)*sqrt(c + d*x))/sqrt(d)))/d^(3/2) - (2*sinh(a + b*x)^2)/(d*sqrt(c + d*x)))
