@testset "6.2 Hyperbolic cosine" begin
	@test integrate((c + d*x)^4*cosh(a + b*x), x) == :((-24*d^3*(c + d*x)*cosh(a + b*x))/b^4 - (4*d*(c + d*x)^3*cosh(a + b*x))/b^2 + (24*d^4*sinh(a + b*x))/b^5 + (12*d^2*(c + d*x)^2*sinh(a + b*x))/b^3 + ((c + d*x)^4*sinh(a + b*x))/b)
	@test integrate((c + d*x)^3*cosh(a + b*x), x) == :((-6*d^3*cosh(a + b*x))/b^4 - (3*d*(c + d*x)^2*cosh(a + b*x))/b^2 + (6*d^2*(c + d*x)*sinh(a + b*x))/b^3 + ((c + d*x)^3*sinh(a + b*x))/b)
	@test integrate((c + d*x)^2*cosh(a + b*x), x) == :((-2*d*(c + d*x)*cosh(a + b*x))/b^2 + (2*d^2*sinh(a + b*x))/b^3 + ((c + d*x)^2*sinh(a + b*x))/b)
	@test integrate((c + d*x)*cosh(a + b*x), x) == :(-((d*cosh(a + b*x))/b^2) + ((c + d*x)*sinh(a + b*x))/b)
	@test integrate(cosh(a + b*x)/(c + d*x), x) == :((cosh(a - (b*c)/d)*coshIntegral((b*c)/d + b*x))/d + (sinh(a - (b*c)/d)*sinhIntegral((b*c)/d + b*x))/d)
	@test integrate(cosh(a + b*x)/(c + d*x)^2, x) == :(-(cosh(a + b*x)/(d*(c + d*x))) + (b*coshIntegral((b*c)/d + b*x)*sinh(a - (b*c)/d))/d^2 + (b*cosh(a - (b*c)/d)*sinhIntegral((b*c)/d + b*x))/d^2)
