	@test integrate((c + d*x)^4*cosh(a + b*x)^2, x) == :((3*d^4*x)/(4*b^4) + (d*(c + d*x)^3)/(2*b^2) + (c + d*x)^5/(10*d) - (3*d^3*(c + d*x)*cosh(a + b*x)^2)/(2*b^4) - (d*(c + d*x)^3*cosh(a + b*x)^2)/b^2 + (3*d^4*cosh(a + b*x)*sinh(a + b*x))/(4*b^5) + (3*d^2*(c + d*x)^2*cosh(a + b*x)*sinh(a + b*x))/(2*b^3) + ((c + d*x)^4*cosh(a + b*x)*sinh(a + b*x))/(2*b))
	@test integrate((c + d*x)^3*cosh(a + b*x)^2, x) == :((3*c*d^2*x)/(4*b^2) + (3*d^3*x^2)/(8*b^2) + (c + d*x)^4/(8*d) - (3*d^3*cosh(a + b*x)^2)/(8*b^4) - (3*d*(c + d*x)^2*cosh(a + b*x)^2)/(4*b^2) + (3*d^2*(c + d*x)*cosh(a + b*x)*sinh(a + b*x))/(4*b^3) + ((c + d*x)^3*cosh(a + b*x)*sinh(a + b*x))/(2*b))
	@test integrate((c + d*x)^2*cosh(a + b*x)^2, x) == :((d^2*x)/(4*b^2) + (c + d*x)^3/(6*d) - (d*(c + d*x)*cosh(a + b*x)^2)/(2*b^2) + (d^2*cosh(a + b*x)*sinh(a + b*x))/(4*b^3) + ((c + d*x)^2*cosh(a + b*x)*sinh(a + b*x))/(2*b))
	@test integrate((c + d*x)*cosh(a + b*x)^2, x) == :((c*x)/2 + (d*x^2)/4 - (d*cosh(a + b*x)^2)/(4*b^2) + ((c + d*x)*cosh(a + b*x)*sinh(a + b*x))/(2*b))
