	@test integrate(cosh(a + b*x)^2/(c + d*x)^2, x) == :(-(cosh(a + b*x)^2/(d*(c + d*x))) + (b*coshIntegral((2*b*c)/d + 2*b*x)*sinh(2*a - (2*b*c)/d))/d^2 + (b*cosh(2*a - (2*b*c)/d)*sinhIntegral((2*b*c)/d + 2*b*x))/d^2)
