	@test integrate(tanh(x)^2/(a + b*coth(x)^2)^(5/2), x) == :(atanh((sqrt(a + b)*coth(x))/sqrt(a + b*coth(x)^2))/(a + b)^(5/2) + (b*tanh(x))/(3*a*(a + b)*(a + b*coth(x)^2)^(3/2)) + (b*(7*a + 4*b)*tanh(x))/(3*a^2*(a + b)^2*sqrt(a + b*coth(x)^2)) - ((3*a + 2*b)*(a + 4*b)*sqrt(a + b*coth(x)^2)*tanh(x))/(3*a^3*(a + b)^2))
