	@test integrate(1/sqrt(-1 - coth(x)^2), x) == :(atan((sqrt(2)*coth(x))/sqrt(-1 - coth(x)^2))/sqrt(2))
	@test integrate(1/(1 + coth(x)^3), x) == :(x/2 - (2*atan((1 - 2*coth(x))/sqrt(3)))/(3*sqrt(3)) - 1/(6*(1 + coth(x))))
	@test integrate(coth(x)*(a + b*coth(x)^4)^(1/2), x) == :((-(1/2))*sqrt(b)*atanh((sqrt(b)*coth(x)^2)/sqrt(a + b*coth(x)^4)) + (1/2)*sqrt(a + b)*atanh((a + b*coth(x)^2)/(sqrt(a + b)*sqrt(a + b*coth(x)^4))) - (1/2)*sqrt(a + b*coth(x)^4))
	@test integrate(coth(x)/(a + b*coth(x)^4)^(1/2), x) == :(atanh((a + b*coth(x)^2)/(sqrt(a + b)*sqrt(a + b*coth(x)^4)))/(2*sqrt(a + b)))
	@test integrate(coth(x)/(a + b*coth(x)^4)^(3/2), x) == :(atanh((a + b*coth(x)^2)/(sqrt(a + b)*sqrt(a + b*coth(x)^4)))/(2*(a + b)^(3/2)) - (a - b*coth(x)^2)/(2*a*(a + b)*sqrt(a + b*coth(x)^4)))
end

