	@test integrate(coth(c + d*x)^4/(a + b*sech(c + d*x)^2)^3, x) == :(x/a^3 - (b^(5/2)*(63*a^2 + 36*a*b + 8*b^2)*atanh((sqrt(b)*tanh(c + d*x))/sqrt(a + b)))/(8*a^3*(a + b)^(9/2)*d) - ((8*a^3 + 32*a^2*b - 15*a*b^2 - 4*b^3)*coth(c + d*x))/(8*a^2*(a + b)^4*d) - ((8*a^2 - 39*a*b - 12*b^2)*coth(c + d*x)^3)/(24*a^2*(a + b)^3*d) - (b*coth(c + d*x)^3)/(4*a*(a + b)*d*(a + b - b*tanh(c + d*x)^2)^2) - (b*(11*a + 4*b)*coth(c + d*x)^3)/(8*a^2*(a + b)^2*d*(a + b - b*tanh(c + d*x)^2)))
	@test integrate(1/(a + b*sech(c + d*x)^2)^4, x) == :(x/a^4 - (sqrt(b)*(35*a^3 + 70*a^2*b + 56*a*b^2 + 16*b^3)*atanh((sqrt(b)*tanh(c + d*x))/sqrt(a + b)))/(16*a^4*(a + b)^(7/2)*d) - (b*tanh(c + d*x))/(6*a*(a + b)*d*(a + b - b*tanh(c + d*x)^2)^3) - (b*(11*a + 6*b)*tanh(c + d*x))/(24*a^2*(a + b)^2*d*(a + b - b*tanh(c + d*x)^2)^2) - (b*(19*a^2 + 22*a*b + 8*b^2)*tanh(c + d*x))/(16*a^3*(a + b)^3*d*(a + b - b*tanh(c + d*x)^2)))
	@test integrate((1 - sech(x)^2)^(3/2), x) == :(coth(x)*log(cosh(x))*sqrt(tanh(x)^2) - (1/2)*coth(x)*(tanh(x)^2)^(3/2))
	@test integrate(sqrt(1 - sech(x)^2), x) == :(coth(x)*log(cosh(x))*sqrt(tanh(x)^2))
	@test integrate(1/sqrt(1 - sech(x)^2), x) == :((log(sinh(x))*tanh(x))/sqrt(tanh(x)^2))
	@test integrate((-1 + sech(x)^2)^(3/2), x) == :((-coth(x))*log(cosh(x))*sqrt(-tanh(x)^2) + (1/2)*tanh(x)*sqrt(-tanh(x)^2))
	@test integrate(sqrt(-1 + sech(x)^2), x) == :(coth(x)*log(cosh(x))*sqrt(-tanh(x)^2))
	@test integrate(1/sqrt(-1 + sech(x)^2), x) == :((log(sinh(x))*tanh(x))/sqrt(-tanh(x)^2))
	@test integrate(sqrt(a + b*sech(x)^2)*tanh(x)^5, x) == :(sqrt(a)*atanh(sqrt(a + b*sech(x)^2)/sqrt(a)) - sqrt(a + b*sech(x)^2) + ((a + 2*b)*(a + b*sech(x)^2)^(3/2))/(3*b^2) - (a + b*sech(x)^2)^(5/2)/(5*b^2))
	@test integrate(sqrt(a + b*sech(x)^2)*tanh(x)^4, x) == :(-((a^2 + 6*a*b - 3*b^2)*atan((sqrt(b)*tanh(x))/sqrt(a + b - b*tanh(x)^2)))/(8*b^(3/2)) + sqrt(a)*atanh((sqrt(a)*tanh(x))/sqrt(a + b - b*tanh(x)^2)) + ((a - 3*b)*tanh(x)*sqrt(a + b - b*tanh(x)^2))/(8*b) - (tanh(x)^3*sqrt(a + b - b*tanh(x)^2))/4)
	@test integrate(sqrt(a + b*sech(x)^2)*tanh(x)^3, x) == :(sqrt(a)*atanh(sqrt(a + b*sech(x)^2)/sqrt(a)) - sqrt(a + b*sech(x)^2) + (a + b*sech(x)^2)^(3/2)/(3*b))
	@test integrate(sqrt(a + b*sech(x)^2)*tanh(x)^2, x) == :(-((a - b)*atan((sqrt(b)*tanh(x))/sqrt(a + b - b*tanh(x)^2)))/(2*sqrt(b)) + sqrt(a)*atanh((sqrt(a)*tanh(x))/sqrt(a + b - b*tanh(x)^2)) - (tanh(x)*sqrt(a + b - b*tanh(x)^2))/2)
	@test integrate(sqrt(a + b*sech(x)^2)*tanh(x)^1, x) == :(sqrt(a)*atanh(sqrt(a + b*sech(x)^2)/sqrt(a)) - sqrt(a + b*sech(x)^2))
	@test integrate(sqrt(a + b*sech(x)^2)*tanh(x)^0, x) == :(sqrt(b)*atan((sqrt(b)*tanh(x))/sqrt(a + b - b*tanh(x)^2)) + sqrt(a)*atanh((sqrt(a)*tanh(x))/sqrt(a + b - b*tanh(x)^2)))
	@test integrate(coth(x)^1*sqrt(a + b*sech(x)^2), x) == :(sqrt(a)*atanh(sqrt(a + b*sech(x)^2)/sqrt(a)) - sqrt(a + b)*atanh(sqrt(a + b*sech(x)^2)/sqrt(a + b)))
	@test integrate(coth(x)^2*sqrt(a + b*sech(x)^2), x) == :(sqrt(a)*atanh((sqrt(a)*tanh(x))/sqrt(a + b - b*tanh(x)^2)) - coth(x)*sqrt(a + b - b*tanh(x)^2))
	@test integrate(coth(x)^3*sqrt(a + b*sech(x)^2), x) == :(sqrt(a)*atanh(sqrt(a + b*sech(x)^2)/sqrt(a)) - ((2*a + b)*atanh(sqrt(a + b*sech(x)^2)/sqrt(a + b)))/(2*sqrt(a + b)) - (1/2)*coth(x)^2*sqrt(a + b*sech(x)^2))
	@test integrate(coth(x)^4*sqrt(a + b*sech(x)^2), x) == :(sqrt(a)*atanh((sqrt(a)*tanh(x))/sqrt(a + b - b*tanh(x)^2)) - ((3*a + 2*b)*coth(x)*sqrt(a + b - b*tanh(x)^2))/(3*(a + b)) - (coth(x)^3*sqrt(a + b - b*tanh(x)^2))/3)
	@test integrate(coth(x)^5*sqrt(a + b*sech(x)^2), x) == :(sqrt(a)*atanh(sqrt(a + b*sech(x)^2)/sqrt(a)) - ((8*a^2 + 12*a*b + 3*b^2)*atanh(sqrt(a + b*sech(x)^2)/sqrt(a + b)))/(8*(a + b)^(3/2)) - ((4*a + 3*b)*coth(x)^2*sqrt(a + b*sech(x)^2))/(8*(a + b)) - (1/4)*coth(x)^4*sqrt(a + b*sech(x)^2))
	@test integrate((a + b*sech(x)^2)^(3/2)*tanh(x)^3, x) == :(a^(3/2)*atanh(sqrt(a + b*sech(x)^2)/sqrt(a)) - a*sqrt(a + b*sech(x)^2) - (a + b*sech(x)^2)^(3/2)/3 + (a + b*sech(x)^2)^(5/2)/(5*b))
	@test integrate((a + b*sech(x)^2)^(3/2)*tanh(x)^2, x) == :(-((3*a^2 - 6*a*b - b^2)*atan((sqrt(b)*tanh(x))/sqrt(a + b - b*tanh(x)^2)))/(8*sqrt(b)) + a^(3/2)*atanh((sqrt(a)*tanh(x))/sqrt(a + b - b*tanh(x)^2)) - ((5*a + b)*tanh(x)*sqrt(a + b - b*tanh(x)^2))/8 + (b*tanh(x)^3*sqrt(a + b - b*tanh(x)^2))/4)
	@test integrate((a + b*sech(x)^2)^(3/2)*tanh(x)^1, x) == :(a^(3/2)*atanh(sqrt(a + b*sech(x)^2)/sqrt(a)) - a*sqrt(a + b*sech(x)^2) - (a + b*sech(x)^2)^(3/2)/3)
	@test integrate((a + b*sech(x)^2)^(3/2)*tanh(x)^0, x) == :((sqrt(b)*(3*a + b)*atan((sqrt(b)*tanh(x))/sqrt(a + b - b*tanh(x)^2)))/2 + a^(3/2)*atanh((sqrt(a)*tanh(x))/sqrt(a + b - b*tanh(x)^2)) + (b*tanh(x)*sqrt(a + b - b*tanh(x)^2))/2)
	@test integrate(coth(x)^1*(a + b*sech(x)^2)^(3/2), x) == :(a^(3/2)*atanh(sqrt(a + b*sech(x)^2)/sqrt(a)) - (a + b)^(3/2)*atanh(sqrt(a + b*sech(x)^2)/sqrt(a + b)) + b*sqrt(a + b*sech(x)^2))
	@test integrate(coth(x)^2*(a + b*sech(x)^2)^(3/2), x) == :(-(b^(3/2)*atan((sqrt(b)*tanh(x))/sqrt(a + b - b*tanh(x)^2))) + a^(3/2)*atanh((sqrt(a)*tanh(x))/sqrt(a + b - b*tanh(x)^2)) - (a + b)*coth(x)*sqrt(a + b - b*tanh(x)^2))
	@test integrate((a + b*sech(c + d*x)^2)^(5/2), x) == :((sqrt(b)*(15*a^2 + 10*a*b + 3*b^2)*atan((sqrt(b)*tanh(c + d*x))/sqrt(a + b - b*tanh(c + d*x)^2)))/(8*d) + (a^(5/2)*atanh((sqrt(a)*tanh(c + d*x))/sqrt(a + b - b*tanh(c + d*x)^2)))/d + (b*(7*a + 3*b)*tanh(c + d*x)*sqrt(a + b - b*tanh(c + d*x)^2))/(8*d) + (b*tanh(c + d*x)*(a + b - b*tanh(c + d*x)^2)^(3/2))/(4*d))
	@test integrate(tanh(x)^5/sqrt(a + b*sech(x)^2), x) == :(atanh(sqrt(a + b*sech(x)^2)/sqrt(a))/sqrt(a) + ((a + 2*b)*sqrt(a + b*sech(x)^2))/b^2 - (a + b*sech(x)^2)^(3/2)/(3*b^2))
	@test integrate(tanh(x)^4/sqrt(a + b*sech(x)^2), x) == :(-((a + 3*b)*atan((sqrt(b)*tanh(x))/sqrt(a + b - b*tanh(x)^2)))/(2*b^(3/2)) + atanh((sqrt(a)*tanh(x))/sqrt(a + b - b*tanh(x)^2))/sqrt(a) + (tanh(x)*sqrt(a + b - b*tanh(x)^2))/(2*b))
	@test integrate(tanh(x)^3/sqrt(a + b*sech(x)^2), x) == :(atanh(sqrt(a + b*sech(x)^2)/sqrt(a))/sqrt(a) + sqrt(a + b*sech(x)^2)/b)
	@test integrate(tanh(x)^2/sqrt(a + b*sech(x)^2), x) == :(-(atan((sqrt(b)*tanh(x))/sqrt(a + b - b*tanh(x)^2))/sqrt(b)) + atanh((sqrt(a)*tanh(x))/sqrt(a + b - b*tanh(x)^2))/sqrt(a))
	@test integrate(tanh(x)^1/sqrt(a + b*sech(x)^2), x) == :(atanh(sqrt(a + b*sech(x)^2)/sqrt(a))/sqrt(a))
	@test integrate(tanh(x)^0/sqrt(a + b*sech(x)^2), x) == :(atanh((sqrt(a)*tanh(x))/sqrt(a + b - b*tanh(x)^2))/sqrt(a))
	@test integrate(coth(x)^1/sqrt(a + b*sech(x)^2), x) == :(atanh(sqrt(a + b*sech(x)^2)/sqrt(a))/sqrt(a) - atanh(sqrt(a + b*sech(x)^2)/sqrt(a + b))/sqrt(a + b))
	@test integrate(coth(x)^2/sqrt(a + b*sech(x)^2), x) == :(atanh((sqrt(a)*tanh(x))/sqrt(a + b - b*tanh(x)^2))/sqrt(a) - (coth(x)*sqrt(a + b - b*tanh(x)^2))/(a + b))
	@test integrate(coth(x)^3/sqrt(a + b*sech(x)^2), x) == :(atanh(sqrt(a + b*sech(x)^2)/sqrt(a))/sqrt(a) - ((2*a + 3*b)*atanh(sqrt(a + b*sech(x)^2)/sqrt(a + b)))/(2*(a + b)^(3/2)) - (coth(x)^2*sqrt(a + b*sech(x)^2))/(2*(a + b)))
	@test integrate(tanh(x)^5/(a + b*sech(x)^2)^(3/2), x) == :(atanh(sqrt(a + b*sech(x)^2)/sqrt(a))/a^(3/2) - (a + b)^2/(a*b^2*sqrt(a + b*sech(x)^2)) - sqrt(a + b*sech(x)^2)/b^2)
	@test integrate(tanh(x)^4/(a + b*sech(x)^2)^(3/2), x) == :(atan((sqrt(b)*tanh(x))/sqrt(a + b - b*tanh(x)^2))/b^(3/2) + atanh((sqrt(a)*tanh(x))/sqrt(a + b - b*tanh(x)^2))/a^(3/2) - ((a + b)*tanh(x))/(a*b*sqrt(a + b - b*tanh(x)^2)))
	@test integrate(tanh(x)^3/(a + b*sech(x)^2)^(3/2), x) == :(atanh(sqrt(a + b*sech(x)^2)/sqrt(a))/a^(3/2) - (a + b)/(a*b*sqrt(a + b*sech(x)^2)))
	@test integrate(tanh(x)^2/(a + b*sech(x)^2)^(3/2), x) == :(atanh((sqrt(a)*tanh(x))/sqrt(a + b - b*tanh(x)^2))/a^(3/2) - tanh(x)/(a*sqrt(a + b - b*tanh(x)^2)))
	@test integrate(tanh(x)^1/(a + b*sech(x)^2)^(3/2), x) == :(atanh(sqrt(a + b*sech(x)^2)/sqrt(a))/a^(3/2) - 1/(a*sqrt(a + b*sech(x)^2)))
	@test integrate(tanh(x)^0/(a + b*sech(x)^2)^(3/2), x) == :(atanh((sqrt(a)*tanh(x))/sqrt(a + b - b*tanh(x)^2))/a^(3/2) - (b*tanh(x))/(a*(a + b)*sqrt(a + b - b*tanh(x)^2)))
