	@test integrate(tanh(x)^4/(a + b*sech(x)^2)^(5/2), x) == :(atanh((sqrt(a)*tanh(x))/sqrt(a + b - b*tanh(x)^2))/a^(5/2) - ((a + b)*tanh(x))/(3*a*b*(a + b - b*tanh(x)^2)^(3/2)) + ((a - 3*b)*tanh(x))/(3*a^2*b*sqrt(a + b - b*tanh(x)^2)))
	@test integrate(tanh(x)^3/(a + b*sech(x)^2)^(5/2), x) == :(atanh(sqrt(a + b*sech(x)^2)/sqrt(a))/a^(5/2) - (a + b)/(3*a*b*(a + b*sech(x)^2)^(3/2)) - 1/(a^2*sqrt(a + b*sech(x)^2)))
	@test integrate(tanh(x)^2/(a + b*sech(x)^2)^(5/2), x) == :(atanh((sqrt(a)*tanh(x))/sqrt(a + b - b*tanh(x)^2))/a^(5/2) - tanh(x)/(3*a*(a + b - b*tanh(x)^2)^(3/2)) - ((2*a + 3*b)*tanh(x))/(3*a^2*(a + b)*sqrt(a + b - b*tanh(x)^2)))
	@test integrate(tanh(x)^1/(a + b*sech(x)^2)^(5/2), x) == :(atanh(sqrt(a + b*sech(x)^2)/sqrt(a))/a^(5/2) - 1/(3*a*(a + b*sech(x)^2)^(3/2)) - 1/(a^2*sqrt(a + b*sech(x)^2)))
