	@test integrate(coth(x)^1/(a + b*sech(x)^2)^(5/2), x) == :(atanh(sqrt(a + b*sech(x)^2)/sqrt(a))/a^(5/2) - atanh(sqrt(a + b*sech(x)^2)/sqrt(a + b))/(a + b)^(5/2) - b/(3*a*(a + b)*(a + b*sech(x)^2)^(3/2)) - (b*(2*a + b))/(a^2*(a + b)^2*sqrt(a + b*sech(x)^2)))
	@test integrate(coth(x)^2/(a + b*sech(x)^2)^(5/2), x) == :(atanh((sqrt(a)*tanh(x))/sqrt(a + b - b*tanh(x)^2))/a^(5/2) - (b*coth(x))/(3*a*(a + b)*(a + b - b*tanh(x)^2)^(3/2)) - (b*(7*a + 3*b)*coth(x))/(3*a^2*(a + b)^2*sqrt(a + b - b*tanh(x)^2)) - ((a - 3*b)*(3*a + b)*coth(x)*sqrt(a + b - b*tanh(x)^2))/(3*a^2*(a + b)^3))
	@test integrate(1/(a + b*sech(c + d*x)^2)^(7/2), x) == :(atanh((sqrt(a)*tanh(c + d*x))/sqrt(a + b - b*tanh(c + d*x)^2))/(a^(7/2)*d) - (b*tanh(c + d*x))/(5*a*(a + b)*d*(a + b - b*tanh(c + d*x)^2)^(5/2)) - (b*(9*a + 5*b)*tanh(c + d*x))/(15*a^2*(a + b)^2*d*(a + b - b*tanh(c + d*x)^2)^(3/2)) - (b*(33*a^2 + 40*a*b + 15*b^2)*tanh(c + d*x))/(15*a^3*(a + b)^3*d*sqrt(a + b - b*tanh(c + d*x)^2)))
end

