	@test integrate((a + b*csch(c + d*x)^2)^4, x) == :(a^4*x - ((2*a - b)*b*(2*a^2 - 2*a*b + b^2)*coth(c + d*x))/d - (b^2*(6*a^2 - 8*a*b + 3*b^2)*coth(c + d*x)^3)/(3*d) - ((4*a - 3*b)*b^3*coth(c + d*x)^5)/(5*d) - (b^4*coth(c + d*x)^7)/(7*d))
	@test integrate((a + b*csch(c + d*x)^2)^3, x) == :(a^3*x - (b*(3*a^2 - 3*a*b + b^2)*coth(c + d*x))/d - ((3*a - 2*b)*b^2*coth(c + d*x)^3)/(3*d) - (b^3*coth(c + d*x)^5)/(5*d))
