	@test integrate(1/(a + b*csch(c + d*x)^2)^3, x) == :(x/a^3 - (sqrt(b)*(15*a^2 - 20*a*b + 8*b^2)*atan((sqrt(a - b)*tanh(c + d*x))/sqrt(b)))/(8*a^3*(a - b)^(5/2)*d) + (b*coth(c + d*x))/(4*a*(a - b)*d*(a - b + b*coth(c + d*x)^2)^2) + ((7*a - 4*b)*b*coth(c + d*x))/(8*a^2*(a - b)^2*d*(a - b + b*coth(c + d*x)^2)))
	@test integrate(1/(a + b*csch(c + d*x)^2)^4, x) == :(x/a^4 - (sqrt(b)*(35*a^3 - 70*a^2*b + 56*a*b^2 - 16*b^3)*atan((sqrt(a - b)*tanh(c + d*x))/sqrt(b)))/(16*a^4*(a - b)^(7/2)*d) + (b*coth(c + d*x))/(6*a*(a - b)*d*(a - b + b*coth(c + d*x)^2)^3) + ((11*a - 6*b)*b*coth(c + d*x))/(24*a^2*(a - b)^2*d*(a - b + b*coth(c + d*x)^2)^2) + (b*(19*a^2 - 22*a*b + 8*b^2)*coth(c + d*x))/(16*a^3*(a - b)^3*d*(a - b + b*coth(c + d*x)^2)))
	@test integrate((a + b*csch(c + d*x)^2)^(5/2), x) == :((a^(5/2)*atanh((sqrt(a)*coth(c + d*x))/sqrt(a - b + b*coth(c + d*x)^2)))/d - (sqrt(b)*(15*a^2 - 10*a*b + 3*b^2)*atanh((sqrt(b)*coth(c + d*x))/sqrt(a - b + b*coth(c + d*x)^2)))/(8*d) - ((7*a - 3*b)*b*coth(c + d*x)*sqrt(a - b + b*coth(c + d*x)^2))/(8*d) - (b*coth(c + d*x)*(a - b + b*coth(c + d*x)^2)^(3/2))/(4*d))
	@test integrate((a + b*csch(c + d*x)^2)^(3/2), x) == :((a^(3/2)*atanh((sqrt(a)*coth(c + d*x))/sqrt(a - b + b*coth(c + d*x)^2)))/d - ((3*a - b)*sqrt(b)*atanh((sqrt(b)*coth(c + d*x))/sqrt(a - b + b*coth(c + d*x)^2)))/(2*d) - (b*coth(c + d*x)*sqrt(a - b + b*coth(c + d*x)^2))/(2*d))
	@test integrate((a + b*csch(c + d*x)^2)^(1/2), x) == :((sqrt(a)*atanh((sqrt(a)*coth(c + d*x))/sqrt(a - b + b*coth(c + d*x)^2)))/d - (sqrt(b)*atanh((sqrt(b)*coth(c + d*x))/sqrt(a - b + b*coth(c + d*x)^2)))/d)
	@test integrate(1/(a + b*csch(c + d*x)^2)^(1/2), x, 3) == :(atanh((sqrt(a)*coth(c + d*x))/sqrt(a - b + b*coth(c + d*x)^2))/(sqrt(a)*d))
	@test integrate(1/(a + b*csch(c + d*x)^2)^(3/2), x) == :(atanh((sqrt(a)*coth(c + d*x))/sqrt(a - b + b*coth(c + d*x)^2))/(a^(3/2)*d) + (b*coth(c + d*x))/(a*(a - b)*d*sqrt(a - b + b*coth(c + d*x)^2)))
	@test integrate(1/(a + b*csch(c + d*x)^2)^(5/2), x) == :(atanh((sqrt(a)*coth(c + d*x))/sqrt(a - b + b*coth(c + d*x)^2))/(a^(5/2)*d) + (b*coth(c + d*x))/(3*a*(a - b)*d*(a - b + b*coth(c + d*x)^2)^(3/2)) + ((5*a - 3*b)*b*coth(c + d*x))/(3*a^2*(a - b)^2*d*sqrt(a - b + b*coth(c + d*x)^2)))
	@test integrate(1/(a + b*csch(c + d*x)^2)^(7/2), x) == :(atanh((sqrt(a)*coth(c + d*x))/sqrt(a - b + b*coth(c + d*x)^2))/(a^(7/2)*d) + (b*coth(c + d*x))/(5*a*(a - b)*d*(a - b + b*coth(c + d*x)^2)^(5/2)) + ((9*a - 5*b)*b*coth(c + d*x))/(15*a^2*(a - b)^2*d*(a - b + b*coth(c + d*x)^2)^(3/2)) + (b*(33*a^2 - 40*a*b + 15*b^2)*coth(c + d*x))/(15*a^3*(a - b)^3*d*sqrt(a - b + b*coth(c + d*x)^2)))
	@test integrate((1 + csch(x)^2)^(3/2), x) == :((-(1/2))*(coth(x)^2)^(3/2)*tanh(x) + sqrt(coth(x)^2)*log(sinh(x))*tanh(x))
	@test integrate(sqrt(1 + csch(x)^2), x) == :(sqrt(coth(x)^2)*log(sinh(x))*tanh(x))
	@test integrate(1/sqrt(1 + csch(x)^2), x) == :((coth(x)*log(cosh(x)))/sqrt(coth(x)^2))
	@test integrate((1 - csch(x)^2)^(3/2), x) == :(2*asin(coth(x)/sqrt(2)) + atanh(coth(x)/sqrt(2 - coth(x)^2)) + (1/2)*coth(x)*sqrt(2 - coth(x)^2))
	@test integrate(sqrt(1 - csch(x)^2), x) == :(asin(coth(x)/sqrt(2)) + atanh(coth(x)/sqrt(2 - coth(x)^2)))
	@test integrate(1/sqrt(1 - csch(x)^2), x) == :(atanh(coth(x)/sqrt(2 - coth(x)^2)))
	@test integrate((-1 + csch(x)^2)^(3/2), x) == :(atan(coth(x)/sqrt(-2 + coth(x)^2)) + 2*atanh(coth(x)/sqrt(-2 + coth(x)^2)) - (1/2)*coth(x)*sqrt(-2 + coth(x)^2))
	@test integrate(sqrt(-1 + csch(x)^2), x) == :(-atan(coth(x)/sqrt(-2 + coth(x)^2)) - atanh(coth(x)/sqrt(-2 + coth(x)^2)))
	@test integrate(1/sqrt(-1 + csch(x)^2), x) == :(atan(coth(x)/sqrt(-2 + coth(x)^2)))
	@test integrate((-1 - csch(x)^2)^(3/2), x) == :((1/2)*coth(x)*sqrt(-coth(x)^2) - sqrt(-coth(x)^2)*log(sinh(x))*tanh(x))
	@test integrate(sqrt(-1 - csch(x)^2), x) == :(sqrt(-coth(x)^2)*log(sinh(x))*tanh(x))
	@test integrate(1/sqrt(-1 - csch(x)^2), x) == :((coth(x)*log(cosh(x)))/sqrt(-coth(x)^2))
end

@testset "6.7 Miscellaneous" begin
	@test integrate(2/(-1 + 3*cosh(4 + 6*x)), x) == :(atan(sqrt(2)*tanh(2 + 3*x))/(3*sqrt(2)))
	@test integrate(1/(2*sinh(2 + 3*x)^2 + cosh(2 + 3*x)^2), x) == :(atan(sqrt(2)*tanh(2 + 3*x))/(3*sqrt(2)))
	@test integrate(sech(2 + 3*x)^2/(1 + 2*tanh(2 + 3*x)^2), x) == :(atan(sqrt(2)*tanh(2 + 3*x))/(3*sqrt(2)))
	@test integrate(csch(2 + 3*x)^2/(2 + coth(2 + 3*x)^2), x) == :(atan(sqrt(2)*tanh(2 + 3*x))/(3*sqrt(2)))
	@test integrate(csch(2 + 3*x)^2/(2 - coth(2 + 3*x)^2), x) == :(-(atanh(sqrt(2)*tanh(2 + 3*x))/(3*sqrt(2))))
	@test integrate(csch(2 + 3*x)^2/(1 + 2*coth(2 + 3*x)^2), x) == :(atan(tanh(2 + 3*x)/sqrt(2))/(3*sqrt(2)))
	@test integrate(csch(2 + 3*x)^2/(1 - 2*coth(2 + 3*x)^2), x) == :(-(atanh(tanh(2 + 3*x)/sqrt(2))/(3*sqrt(2))))
	@test integrate(cosh(a + b*x)*sinh(a + b*x), x) == :(sinh(a + b*x)^2/(2*b))
	@test integrate(cosh(a + b*x)*sinh(a + b*x)^n, x) == :(sinh(a + b*x)^(1 + n)/(b*(1 + n)))
	@test integrate(cosh(a + b*x)^3*sinh(a + b*x)^n, x) == :(sinh(a + b*x)^(1 + n)/(b*(1 + n)) + sinh(a + b*x)^(3 + n)/(b*(3 + n)))
	@test integrate(cosh(a + b*x)^5*sinh(a + b*x)^n, x) == :(sinh(a + b*x)^(1 + n)/(b*(1 + n)) + (2*sinh(a + b*x)^(3 + n))/(b*(3 + n)) + sinh(a + b*x)^(5 + n)/(b*(5 + n)))
	@test integrate(cosh(a + b*x)^m*sinh(a + b*x), x) == :(cosh(a + b*x)^(1 + m)/(b*(1 + m)))
	@test integrate(cosh(a + b*x)^m*sinh(a + b*x)^3, x) == :(-(cosh(a + b*x)^(1 + m)/(b*(1 + m))) + cosh(a + b*x)^(3 + m)/(b*(3 + m)))
	@test integrate(cosh(a + b*x)^m*sinh(a + b*x)^5, x) == :(cosh(a + b*x)^(1 + m)/(b*(1 + m)) - (2*cosh(a + b*x)^(3 + m))/(b*(3 + m)) + cosh(a + b*x)^(5 + m)/(b*(5 + m)))
	@test integrate(cosh(a + b*x)^2*sinh(a + b*x)^2, x) == :(-(x/8) - (cosh(a + b*x)*sinh(a + b*x))/(8*b) + (cosh(a + b*x)^3*sinh(a + b*x))/(4*b))
	@test integrate(cosh(a + b*x)^2*sinh(a + b*x)^4, x) == :(x/16 + (cosh(a + b*x)*sinh(a + b*x))/(16*b) - (cosh(a + b*x)^3*sinh(a + b*x))/(8*b) + (cosh(a + b*x)^3*sinh(a + b*x)^3)/(6*b))
	@test integrate(cosh(a + b*x)^2*sinh(a + b*x)^6, x) == :(-((5*x)/128) - (5*cosh(a + b*x)*sinh(a + b*x))/(128*b) + (5*cosh(a + b*x)^3*sinh(a + b*x))/(64*b) - (5*cosh(a + b*x)^3*sinh(a + b*x)^3)/(48*b) + (cosh(a + b*x)^3*sinh(a + b*x)^5)/(8*b))
	@test integrate(cosh(a + b*x)^4*sinh(a + b*x)^2, x) == :(-(x/16) - (cosh(a + b*x)*sinh(a + b*x))/(16*b) - (cosh(a + b*x)^3*sinh(a + b*x))/(24*b) + (cosh(a + b*x)^5*sinh(a + b*x))/(6*b))
	@test integrate(cosh(a + b*x)^4*sinh(a + b*x)^4, x) == :((3*x)/128 + (3*cosh(a + b*x)*sinh(a + b*x))/(128*b) + (cosh(a + b*x)^3*sinh(a + b*x))/(64*b) - (cosh(a + b*x)^5*sinh(a + b*x))/(16*b) + (cosh(a + b*x)^5*sinh(a + b*x)^3)/(8*b))
	@test integrate(cosh(a + b*x)^4*sinh(a + b*x)^6, x) == :(-((3*x)/256) - (3*cosh(a + b*x)*sinh(a + b*x))/(256*b) - (cosh(a + b*x)^3*sinh(a + b*x))/(128*b) + (cosh(a + b*x)^5*sinh(a + b*x))/(32*b) - (cosh(a + b*x)^5*sinh(a + b*x)^3)/(16*b) + (cosh(a + b*x)^5*sinh(a + b*x)^5)/(10*b))
	@test integrate(cosh(a + b*x)^6*sinh(a + b*x)^2, x) == :(-((5*x)/128) - (5*cosh(a + b*x)*sinh(a + b*x))/(128*b) - (5*cosh(a + b*x)^3*sinh(a + b*x))/(192*b) - (cosh(a + b*x)^5*sinh(a + b*x))/(48*b) + (cosh(a + b*x)^7*sinh(a + b*x))/(8*b))
	@test integrate(cosh(a + b*x)^6*sinh(a + b*x)^4, x) == :((3*x)/256 + (3*cosh(a + b*x)*sinh(a + b*x))/(256*b) + (cosh(a + b*x)^3*sinh(a + b*x))/(128*b) + (cosh(a + b*x)^5*sinh(a + b*x))/(160*b) - (3*cosh(a + b*x)^7*sinh(a + b*x))/(80*b) + (cosh(a + b*x)^7*sinh(a + b*x)^3)/(10*b))
	@test integrate(cosh(a + b*x)^6*sinh(a + b*x)^6, x) == :(-((5*x)/1024) - (5*cosh(a + b*x)*sinh(a + b*x))/(1024*b) - (5*cosh(a + b*x)^3*sinh(a + b*x))/(1536*b) - (cosh(a + b*x)^5*sinh(a + b*x))/(384*b) + (cosh(a + b*x)^7*sinh(a + b*x))/(64*b) - (cosh(a + b*x)^7*sinh(a + b*x)^3)/(24*b) + (cosh(a + b*x)^7*sinh(a + b*x)^5)/(12*b))
	@test integrate(csch(a + b*x)*sech(a + b*x), x) == :(log(tanh(a + b*x))/b)
