	@test integrate(cosh(x)^2/(a + b*cosh(2*x)), x) == :(x/(2*b) - (sqrt(a - b)*atanh((sqrt(a - b)*tanh(x))/sqrt(a + b)))/(2*b*sqrt(a + b)))
	@test integrate(tanh(c + d*x)/sqrt(a*sinh(c+d*x)^2), x) == :(atan(sqrt(a*sinh(c + d*x)^2)/sqrt(a))/(sqrt(a)*d))
