	@test integrate(x^5*cosh(a + b*x^3)^7*sinh(a + b*x^3), x) == :(-((35*x^3)/(3072*b)) + (x^3*cosh(a + b*x^3)^8)/(24*b) - (35*cosh(a + b*x^3)*sinh(a + b*x^3))/(3072*b^2) - (35*cosh(a + b*x^3)^3*sinh(a + b*x^3))/(4608*b^2) - (7*cosh(a + b*x^3)^5*sinh(a + b*x^3))/(1152*b^2) - (cosh(a + b*x^3)^7*sinh(a + b*x^3))/(192*b^2))
	# @test integrate(csch(x^5)/x, x) == :(x))
	@test integrate(cosh(x)^2/(1 + exp(x)), x) == :(-(1/8)/exp((2*x) + 1/(E^x*4) + E^x/4 + (3*x)/4 - log)(1 + exp(x)))
	@test integrate(sqrt(1 + sech(x))*sech(x)*tanh(x)^3, x) == :((-(4/5))*(1 + sech(x))^(5/2) + (2/7)*(1 + sech(x))^(7/2))
