	@test integrate((sech(a + b*x)^2 - csch(a + b*x)^2)/(sech(a + b*x)^2 + csch(a + b*x)^2), x) == :(-(atan(tanh(a + b*x))/b))
	@test integrate((sech(a + b*x)^3 - csch(a + b*x)^3)/(sech(a + b*x)^3 + csch(a + b*x)^3), x) == :((4*atan((1 - 2*tanh(a + b*x))/sqrt(3)))/(3*sqrt(3)*b) + 1/(3*b*(1 + tanh(a + b*x))))
	@test integrate((sech(a + b*x)^4 - csch(a + b*x)^4)/(sech(a + b*x)^4 + csch(a + b*x)^4), x) == :(atan(1 - sqrt(2)*tanh(a + b*x))/(sqrt(2)*b) - atan(1 + sqrt(2)*tanh(a + b*x))/(sqrt(2)*b))
